import React from 'react'
import { Routes, Route } from "react-router-dom";
import Product from "./pages/products";
import {ToastContainer, toast } from "react-toastify";

const theme = createTheme({
    palette: {
      primary: {
        main: purple[500],
      },
      secondary: {
        main: '#f44336',
      },
    },
  });

const App = () => {
  return (
    <div className="App">
      <ToastContainer/>
    <Routes>
      <Route path="/" element={<Product/>} />

    </Routes>
  </div>
  )
}

export default App
